--  DDL for Trigger TG_ID_AUTO_USER
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "TG_ID_AUTO_USER" 
  BEFORE INSERT ON USERS
  FOR EACH ROW
BEGIN
  SELECT
   ID_auto.NEXTVAL INTO :NEW.ID FROM DUAL;
END;
/
